<!DOCTYPE html>
<html lang="fr">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Comparaison multi-solveurs</title>
  
  <style>
  /* templates/style.css */
@import url('https://fonts.googleapis.com/css2?family=Lato:wght@400;700&family=Roboto+Slab:wght@400;700&display=swap');

:root {
    --primary-color: #003366;
    --secondary-color: #4a6a8a;
    --border-color: #cccccc;
    --bg-light: #f8f9fa;
    --text-color: #333333;
}

body {
    font-family: 'Lato', sans-serif;
    line-height: 1.6;
    color: var(--text-color);
    margin: 0;
    padding: 0;
    background-color: #fff;
}

.report-container {
    max-width: 800px;
    margin: 40px auto;
    padding: 20px 40px;
    border: 1px solid var(--border-color);
    box-shadow: 0 0 10px rgba(0,0,0,0.05);
}

header {
    text-align: center;
    border-bottom: 2px solid var(--primary-color);
    padding-bottom: 20px;
    margin-bottom: 30px;
}

header h1 {
    font-family: 'Roboto Slab', serif;
    color: var(--primary-color);
    margin: 0;
}

header .project-meta {
    font-size: 0.9em;
    color: #666;
}

h2 {
    font-family: 'Roboto Slab', serif;
    color: var(--primary-color);
    border-bottom: 1px solid var(--border-color);
    padding-bottom: 10px;
    margin-top: 40px;
}

h3 {
    font-family: 'Roboto Slab', serif;
    color: var(--secondary-color);
    margin-top: 30px;
}

.toc {
    background: var(--bg-light);
    border: 1px solid #e0e0e0;
    padding: 15px 25px;
    margin-bottom: 30px;
}

.toc ul {
    list-style-type: none;
    padding-left: 0;
}

.toc li a {
    text-decoration: none;
    color: var(--primary-color);
}

.calculation-section {
    margin-bottom: 40px;
    padding-bottom: 20px;
    border-bottom: 1px dashed var(--border-color);
}

.calc-meta {
    font-size: 0.8em;
    color: #777;
    background: var(--bg-light);
    padding: 8px;
    border: 1px solid #eee;
    margin-bottom: 15px;
    word-wrap: break-word;
}

.calc-meta code {
    background: #e0e0e0;
    padding: 2px 4px;
    border-radius: 3px;
}

/* Style pour les tableaux récapitulatifs */
.recap-table {
    width: 100%;
    border-collapse: collapse;
    margin-top: 20px;
    margin-bottom: 20px;
    font-size: 0.9em;
}

.recap-table th, .recap-table td {
    border: 1px solid var(--border-color);
    padding: 8px 12px;
    text-align: left;
}

.recap-table thead {
    background-color: var(--secondary-color);
    color: white;
    font-weight: bold;
}

.recap-table tbody tr:nth-child(even) {
    background-color: var(--bg-light);
}

/* Transparence Mathématique */
details {
    margin-top: 15px;
    background: #fafafa;
    border: 1px solid #eee;
    padding: 10px;
}

summary {
    cursor: pointer;
    font-weight: bold;
    color: var(--secondary-color);
}

footer {
    text-align: center;
    margin-top: 40px;
    padding-top: 20px;
    border-top: 1px solid var(--border-color);
    font-size: 0.8em;
    color: #888;
}

@media print {
    body { font-size: 10pt; }
    .report-container { border: none; box-shadow: none; margin: 0; padding: 0; max-width: 100%; }
    .toc { display: none; }
    footer { display: none; }
    h2 { page-break-before: always; }
}

  </style>
  
  <style>
    body{font-family:Inter,Segoe UI,system-ui,Arial,sans-serif;margin:0;background:#0b0f13;color:#e7edf4}
    .container{max-width:1200px;margin:0 auto;padding:24px}
    .tabs{display:flex;gap:8px;flex-wrap:wrap;margin-bottom:12px}
    .tab{padding:8px 12px;border:1px solid #233041;border-radius:8px;background:#11161c;color:#e7edf4;cursor:pointer}
    .tab.active{background:#161c23;border-color:#4aa3ff}
    .panel{display:none}
    .panel.active{display:block}
    .cards{display:grid;grid-template-columns:repeat(3,1fr);gap:12px}
    .card{background:#11161c;border:1px solid #233041;border-radius:10px;padding:12px}
    .kpi{display:flex;justify-content:space-between;margin:6px 0}
    .kpi .label{color:#9db0c2}
    .kpi .value{font-weight:600}
    .chart{margin-top:12px;background:#11161c;border:1px solid #233041;border-radius:10px;padding:12px}
    .bar-row{display:flex;align-items:center;gap:8px;margin:6px 0}
    .bar-label{width:140px;color:#9db0c2;white-space:nowrap;overflow:hidden;text-overflow:ellipsis}
    .bar{height:10px;background:#4aa3ff;border-radius:6px}
    .section{margin-top:18px}
    .section h3{margin:6px 0}
    table.comp{width:100%;border-collapse:collapse;margin-top:8px}
    table.comp th, table.comp td{border:1px solid #233041;padding:6px;text-align:left}
    table.comp th{background:#0e141a}
    .info{color:#9db0c2; margin-bottom:8px}
  </style>
</head>
